const Dashboard = () => {
  const customer = JSON.parse(localStorage.getItem('customer'));

  return (
    <div>
      <h2>Welcome, {customer?.first_name}</h2>
      <a href="/create-project"><button>Create New Trip</button></a>
    </div>
  );
};

export default Dashboard;
